import "./landing.scss";
import smile from "../../img/smile.svg";
import { useEffect, useRef } from "react";
import { init } from "ityped";

export default function Landing() {
  const textRef = useRef();
  const textRef2 = useRef();
  const textRef3 = useRef();
  const textRef4 = useRef();
  useEffect(() => {
    init(textRef.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: [
        "Developer",
        "Technical Writer",
        "IT Generalist",
        "Security Enthusiast",
      ],
    });
    init(textRef2.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: ["Technical Writer"],
    });
    init(textRef3.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: ["IT Generalist"],
    });
    init(textRef4.current, {
      showCursor: true,
      backDelay: 1000,
      backSpeed: 60,
      strings: ["Security Enthusiast"],
    });
  });
  return (
    <div className="landing">
      <div className="heading-wrapper">
        <h1>Digital Carpentry</h1>
        <h1>
          Turning Ideas &gt;
          <img className="smile-icon" src={smile} alt=""></img>
        </h1>
        <p className="text-fade-in upper-text">Meet Tobias</p>
        <div className="text-fade-in text-wrapper">
          <p ref={textRef}></p>
          <p ref={textRef2}></p>
          <p ref={textRef3}></p>
          <p ref={textRef4}></p>
        </div>
        <span></span>
      </div>
    </div>
  );
}
